INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (1, 'cn', '1', '', '公司简介', '#333333', '', '', 'admin', '本站', '', '2018-04-11 17:26:11', '/static/upload/image/20201111/1605058225813052.jpg', '', '&lt;p class=&quot;p1&quot;&gt; 苏州泰肯电子科技有限公司专业研发、生产高性能连接器产品。电流从3A到125A,耐压从1000V到3000V，极数从2针到19针，防护等级从IP44到IP68,可以满足各种需求和使用环境。广泛应用于自动化设备，通讯，电力，机床，照明，电动汽车，航海等各个领域。公司已经通过了ISO9001质量管理体系认证，取得欧盟CE，Rohs等认证证书。&lt;/p&gt;&lt;p class=&quot;p2&quot;&gt; TECONICS(泰肯)品牌定位于高科技，高性能电子连接器产品。在泰肯，质量永远排在首位。我们有专业的研发团队，高质素的员工队伍，现代化的生产设备，完善的检测实验室，严格执行中国国家标准&lt;/p&gt;&lt;div class=&quot;hr&quot;&gt;&lt;/div&gt;&lt;p class=&quot;p1&quot;&gt; GB/T11918、GB/T11919,共同采用IEC60309-1,-2国际标准。可以根据客户的特殊要求开发各种连接器,专业的研发团队、稳定可靠的管理流程、严谨的供应链管理，这就是我们能够做到领先行业、和国际接轨的标志和保证。&lt;/p&gt;&lt;p class=&quot;p2&quot;&gt;携手泰肯，-起共赢!&lt;/p&gt;', '', '/static/upload/image/20201111/1605075346229330.jpg', '', 'PbootCMS是全新内核且永久开源免费的PHP企业网站开发建设管理系统，是一套高效、简洁、 强悍的可免费商用的PHP CMS源码，能够满足各类企业网站开发建设的需要。系统采用简单到想哭的模板标签，只要懂HTML就可快速开发企业网站。官方提供了大量网站模板免费下载和使用，将致力于为广大开发者和企', 255, '1', '0', '0', '0', 75, 0, 0, 'admin', 'admin', '2018-04-11 17:26:11', ' 2020-11-11 14:16:13', '4', '', '');
