INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (3, 'cn', '11', '', '联系我们', '#333333', '', '', 'admin', '本站', '', '2018-04-11 17:31:29', '', '', '<p>官方网站：<a href=`http://www.pbootcms.com`>www.pbootcms.com</a><br/></p><p>技术交流群： 137083872</p><p><br/></p><p>我们一直秉承大道至简分享便可改变世界的理念，坚持做最简约灵活的PbootCMS开源软件！</p><p>您的每一份帮助都将支持PbootCMS做的更好，走的更远！</p><p>我们一直在坚持不懈地努力，并尽可能让PbootCMS完全开源免费，您的帮助将使我们更有动力和信心^_^！</p><p>扫一扫官网付款码赞助我们，您的支持是开发者不断前进的动力！</p><p><br/></p><p><strong>您的每一份捐赠将用来：</strong></p><p>深入PbootCMS核心的开发、</p><p>做丰富的应用；</p><p>设计更爽的用户界面；</p><p>吸引更多的模板开发者和应用开发者；</p><p>奖励更多优秀贡献者。</p><p>把PbootCMS技术交流群137083872推荐给伱自己有兴趣的群做宣传，也是对我们的帮助哟！~~</p><p><img src=`/static/upload/image/20180413/1523583018133454.png`/></p><p><br/></p>', '', '', '', '', 255, '1', '0', '0', '0', 115, 0, 0, 'admin', 'admin', '2018-04-11 17:31:29', '2018-04-13 09:30:19', '4', '', '');
