INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (27, 'cn', '14', '', '公司愿景3', '#333333', '', '', 'admin', '本站', '', '2020-11-11 10:44:20', '', '', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 12px; padding: 0px; font-size: 6px; color: rgb(153, 153, 153); line-height: 24px; font-family: 微软雅黑; white-space: normal;&quot;&gt;本公司长期信奉“质量第一诚信守约质优价廉满足需求有求必应合作共赢。”公司以质量为重点，人才为保证,效益为根本的经营理念。坚持创新进取.精益求精,凭倡公司一流的产品质量,良好的信誉和企业的形象,为大企业和客户服务。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 12px; padding: 0px; font-size: 6px; color: rgb(153, 153, 153); line-height: 24px; font-family: 微软雅黑; white-space: normal;&quot;&gt;本公司产品广泛用于自动化设备。通讯，力.机床.照明.电动汽车。航海等各个领域。公司热忱欢迎国内外新老朋友光临，愿为您提供优质的服务，与您共同发展.共创辉煌。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '', '', '本公司长期信奉“质量第一诚信守约质优价廉满足需求有求必应合作共赢。”公司以质量为重点，人才为保证,效益为根本的经营理念。坚持创新进取.精益求精,凭倡公司一流的产品质量,良好的信誉和企业的形象,为大企业和客户服务。本公司产品广泛用于自动化设备。通讯，力.机床.照明.电动汽车。航海等各个领域。公司热忱欢迎国内外', 24, '1', '0', '0', '0', 0, 0, 0, 'admin', 'admin', '2020-11-11 10:46:39', ' 2020-11-12 08:34:34', '4', '0', '');
INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (28, 'cn', '15', '', '依据什么标准采用航空插头连接器', '#333333', '', '', 'admin', '本站', '', '2020-11-11 11:20:49', '', '', '&lt;p&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;一台机器的内部结构非常的复杂繁琐，而且机器、电器、设备的组成都离不开连接器，常需要用到的连接器就包括有：SIM卡座，SD/TF卡座，SATA连接器，板对板连接器，PCIE连接器，USB连接器等，这些连接器就已经成为了必不可缺的电子配件，电子连接器的使用性能、规格尺寸都有所不同，下面由科技为您详细介绍，连接器产品主要都使用在哪些产品上：物控产品、网络接收器、机顶盒、数码相机、电脑周边、播放机类、汽车及汽车周边产品，无人机、记录仪、安防设备、医疗设备等等多种用途。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 连接器的基本结构件有：接触件、外壳、绝缘体、附件&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 1、接触件是连接器完成电连接功能的核心零件。一般是由阳性接触件和阴性接触件两部分组成接触的，通过阴阳接触件的插合完成的电连接。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 阳性接触件是刚性零件，其中形状分为圆柱形（圆插针），方柱形，或扁平形。阳性接触件一般是由黄铜，磷青铜制成的。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 阴性接触件即插孔，是接触的关键零件，他是依靠弹性结构在与插针插合时发生弹性变形而产生弹性力与阳性接触件形成紧密接触，完成连接。插孔的结构种类有很多，分别有圆筒型，音叉型、悬臂梁型、盒型等等。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 2、壳体：也称外壳，也就是连接器的外罩，它由内装的绝缘安装板和插针提供机械保护，并且提供插头和插座合适对准，将连接器固定到设备上&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 3、绝缘体：绝缘体称为基座或者安装版，它的作用就是使接触件按锁需要的位置和间距进行排列，并且保证接触件之间和接触件外壳之间的绝缘性能。良好的绝缘电阻、耐点压性能以及易加工性是选择绝缘材料加工成绝体的基本要求。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 4、附件：附件分结构附件和安装附件两种。结构附件入卡圈、定位健、定位销、导向销、联接环、电缆夹、密封圈、密封垫。安装附件乳螺钉、螺母、螺杆、弹簧圈等。附件大部分都是有标准件和通用件的。&lt;/span&gt;&lt;/p&gt;', '', '', '', '1、在挑选电连接器时，最先要考虑到工作电压和电流量和电阻器中间的关系，接触电阻——针对低特性阻抗电源电路，航空插头连接器是串连在电源电路中时，接触电阻是重要主要参数。较大电流量——受航空插头连接器以及端接的输电线号所限定。较大工作电压——在于电源电路间的空隙（即触碰件间隔和爬电距离）及选用的导热材料。', 101, '1', '0', '0', '0', 0, 0, 0, 'admin', 'admin', '2020-11-11 11:21:13', ' 2020-11-12 11:57:27', '4', '0', '');
