ing: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 4、附件：附件分结构附件和安装附件两种。结构附件入卡圈、定位健、定位销、导向销、联接环、电缆夹、密封圈、密封垫。安装附件乳螺钉、螺母、螺杆、弹簧圈等。附件大部分都是有标准件和通用件的。&lt;/span&gt;&lt;/p&gt;', '', '', '', '圆形连接器的防水等级：在湿冷自然环境下或是在液體中，圆形连接器航空插头插座常遭受液體的滴进、喷到或是入侵，因而导入防水等级可以合理防止所述难题产生。通常情况下，人们能够用iP编码来表达圆形连接器的防水等级，即IPx(x为0到8的大数字，越大表达防水等级越高)，具体如下。当x=0 - 对水无一切维护。当x=1 - 避免水珠', 102, '1', '0', '0', '0', 10, 0, 0, 'admin', 'admin', '2020-11-11 11:21:34', ' 2020-11-12 11:57:27', '4', '0', '');
