INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (74, 'cn', '15', '', '防水连接器结构分为插头和插座两部分', '#333333', '', '', 'admin', '本站', '', '2020-11-12 11:50:02', '', '', '&lt;p&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;防水连接器可以应用到带水的环境中，它具有过硬的密封性能，可靠的防水性能。比如有些设备如果是要进入水里或者在水底安装，那么使用防水连接器就可以不用担心连接器因水特别是含化学物质较多的水的进入而损害机械设备的问题。&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp; &amp;nbsp; 防水连接器是连接不同电线的通电效果的，因此在传输效率上还是会明显的升级。在连接器的角度来说，各方面的技术标准和优点上还是会越来越多。只有看出来设计的特色和优势来说，始终还是会知道其中的特色和功能上还是会更加与众不同，达到了在设计上越来越好的效果，这一切都是要在运用链接的过程中才能够看出其中效果怎么样的。掌握好其连接的作用和效果，都觉得安装使用的时候，功能会越来越完善的。&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp; &amp;nbsp; 防水连接器的壳体是外罩部分它内部设有绝缘安装模块和机械保护装置，能够让插头与插座顺利完成准确对接从而让连接器固定到使用设备上。&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp; &amp;nbsp; 对于防水连接器防水性能的主要评定标准是依据IP防水等级标准。看防水连接器防水性能如何，主要看IPXX的后面第两位数字，位X是从0到6，较大等级为6，为防尘标识；第2位数字是从0到8，较大等级为8；因此防水连接器的较大防水等级为IPX8。 密封原理：依靠多达5处密封圈和密封环以压力预紧密封。这种密封在连接器热胀冷缩时，不会丧失预紧力，长时间保证防水效果，水分子不可能在普通压力下穿透。&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;br style=&quot;color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp; &amp;nbsp; 防水连接器结构分为插头和插座两部分，通常使用时，插座安装于仪器设备上，通过安装法兰固定，插头结构为电缆形式，可与插座对接实现传输功能。对接端具有一个长方形的橡胶圈，两端设于安装螺纹孔，尾端采用环氧树脂灌封、密封。&lt;/span&gt;&lt;/p&gt;', '', '', '', '防水连接器可以应用到带水的环境中，它具有过硬的密封性能，可靠的防水性能。比如有些设备如果是要进入水里或者在水底安装，那么使用防水连接器就可以不用担心连接器因水特别是含化学物质较多的水的进入而损害机械设备的问题。 防水连接器是连接不同电线的通电效果的，因此在传输效率上还是会明显的升级。在连', 103, '1', '0', '0', '0', 0, 0, 0, 'admin', 'admin', '2020-11-12 11:52:53', ' 2020-11-12 11:57:27', '4', '0', '');
INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (75, 'cn', '15', '', '电子连接器摩擦腐蚀与电镀问题', '#333333', '', '', 'admin', '本站', '', '2020-11-12 11:52:54', '', '', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;腐蚀性气体、高湿度和强烈振荡是引起氧化作用和摩擦腐蚀，并导致连接器故障的三大条件。这些环境因素会对锡和铅锡接触表面造成极大的影响，有90%的连接器表面属于这种情况。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;在通常的情况下，人们采用电镀贵重金属的方式，如镀金或镀银，因为这些金属不会发生氧化作用。这些镀层的厚度从0.5μm至1.27μm不等。然而，令人遗憾的是，由于含有 这些贵重金属以及对其加工使得这类电镀工艺价格不菲，所以人们尽可能少用这类电镀材料。在汽车电气线束应用中，大约只有10%的连接点使用了这类金属。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;其结果是，一些主要的连接器供应商，例如FCI给出了其他可供选择的电镀解决方案(例如纯锡电镀、锡-特氟隆TinTeflon、NXT和压合技术)，不仅满足了OEM的成本要求，而且产品具有同样的性能。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;随着社会的发展人们的生活水平在不断的提高，当然汽车也是如此，汽车制造商对其供应基地的要求越来越高，这对于汽车零配件供应商来说已经是一件众所周知的事情了。就连接器供应商而言，这意味着对产品的性能、稳定性和成本的要求更加严格。供应商只有不断革新产品及工艺，满足客户的这些需求，才能处于优势地位。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;一辆典型轻型汽车大约有1500个连接点，其中50%到60%用于关键的配电功能。汽车连接器被用于日益恶劣的环境，包括温度(低至零下40°C，高达零上155°C)、振动、氧化作用以及摩擦腐蚀，我们开始认识到设计攻关的重要性。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;但实际上这件事情做起来并不简单，大多数商业电子元器件出现故障时最多让人感到烦恼失意，可是如果关键汽车零配件连接出现问题，则会引起火灾报警器、制动器或安全气囊失灵，导致严重的后果。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;电子连接器制造商必须识别并分析环境中那些可能对连接器性能造成影响的物理和机械现象。按照汽车制造商规定的应用条件，为了评估连接器的稳定性，连接器制造商实施了精细的测试程序。如果出现连接器故障，大多可确定为下述三种故障模式之一：摩擦腐蚀、电气故障以及连接器接插问题。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '', '', '腐蚀性气体、高湿度和强烈振荡是引起氧化作用和摩擦腐蚀，并导致连接器故障的三大条件。这些环境因素会对锡和铅锡接触表面造成极大的影响，有90%的连接器表面属于这种情况。在通常的情况下，人们采用电镀贵重金属的方式，如镀金或镀银，因为这些金属不会发生氧化作用。这些镀层的厚度从0.5μm至1.27μm不等。然而，令人遗憾', 104, '1', '0', '0', '0', 0, 0, 0, 'admin', 'admin', '2020-11-12 11:53:14', ' 2020-11-12 11:57:27', '4', '0', '');
INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (76, 'cn', '15', '', '使用防水插头连接器那些情况需要注意？', '#333333', '', '', 'admin', '本站', '', '2020-11-12 11:53:15', '', '', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;防水插头连接器就是指有一个或一个以上电源电路布线可插进的座，经过它可插进各种布线，有利于与其他电源电c路接入。我们日常日子中，常用的就是电源插头，电源插头是为电器产品提供电源接口的电器设备，也是住房电气设计中运用较多的电气设备附注，它与人们日子有着十严密的关系。如何购买具有安全系数的电源插头很重要，低品质的电源插头经常引起人身安全高压电击和电气设备安全事故，给人身安全资金安全带来重特大安全隐患。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;防水插头连接器以确保对电源插头插销有满足的接触压力。插套应抗腐蚀和耐磨损，以确保电源插头和电源插座插合部分接触杰出；电源插头的插销应锁住，不能转动，不然会影响插进功能和发生不安全因素；转化器有铜线定位设备，以确保铜线固定，能承受住正常的抗拉力和扭矩等；电源插头和电源插座插合时，插合表面之间应基本严实，以避免引起安全事故。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;strong&gt;防水插头连接器归类使用：&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;数据信号传送防水插头连接器：数据信号传输可分为两大类：模拟仿真数据信号传输及模拟信号传输。不管模拟仿真或模拟信号射频连接器，其需求功能首要还应维护所传输的工作电压差分信号的一致性，该一致性应包含差分信号的波型以及其震幅。数据信号在单脉冲频率上与模拟仿真数据信号有所区别，其单脉冲传送速度决定了所维护的单脉冲的最大频率，数据单脉冲的传送速度比一些典型性的模拟仿真数据信号要快得多，有的单脉冲在射频连接器中的传送速度已贴近千亿元分之一秒的范围，在现如今电子信息技术行业中，一般把射频连接器作为一输电线对待，因为与增长这般之快的频率相关的光波长能比得过射频连接器的尺度。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;strong&gt;防水插头连接器的使用归类&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;操控射频连接器的特色特性阻抗成为一大意识时髦潮流，在电缆线中就是对串音进行操控。特色特性阻抗在防水插头连接器中往往具有这般重要的影响力，由于电阻器的几何图形外观设计很难做到完全一致，因之射频连接器尺度又不大，必须将串音的概率最小化。在电缆线中，航空插头几何图形形状的操控最易实现，其特色特性阻抗也易操控，可是电缆线的长短将有可能引起潜在性的串音。当连接器航空插头或者一相互之间连络体系诸如此类一电缆线装配线被使用于髙速数据信号传送中，相应的对射频连接器功能的叙说也就改变了。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '', '', '防水插头连接器就是指有一个或一个以上电源电路布线可插进的座，经过它可插进各种布线，有利于与其他电源电c路接入。我们日常日子中，常用的就是电源插头，电源插头是为电器产品提供电源接口的电器设备，也是住房电气设计中运用较多的电气设备附注，它与人们日子有着十严密的关系。如何购买具有安全系数的电源插头很重要，低', 105, '1', '0', '0', '0', 0, 0, 0, 'admin', 'admin', '2020-11-12 11:53:35', ' 2020-11-12 11:57:27', '4', '0', '');
INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (77, 'cn', '15', '', '哪些因素决定了防水连接器的质量？', '#333333', '', '', 'admin', '本站', '', '2020-11-12 11:53:36', '', '', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;防水连接器是可以在水中承受一定的水压，那么，哪些因素决定了防水连接器的质量？&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目前防水连接器使用到的制造工艺有精密制作工艺，光源信号和低温低压成型技术以及机电布局结合开发技术。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;精密制作工艺：改技术首要对应距离小、厚度薄等技术，需要保证在超精密制作范畴达到全球同业的先进水平。低温低压成型技术：在防水连接器制造过程中使用密封性、物理、化学热熔让防水连接器达到绝缘防水，封装后保证焊点不受外力影响，保证防水连接器的质量可靠性。光源信号和机电布局结合开发技术：能够应用到置入电子组件的音频防水连接器上，在防水连接器增加电子零组件可以让防水连接器拥有两种功能打破传统防水连接器的规划。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '', '', '防水连接器是可以在水中承受一定的水压，那么，哪些因素决定了防水连接器的质量？目前防水连接器使用到的制造工艺有精密制作工艺，光源信号和低温低压成型技术以及机电布局结合开发技术。精密制作工艺：改技术首要对应距离小、厚度薄等技术，需要保证在超精密制作范畴达到全球同业的先进水平。低温低压成型技术：在防水连接', 106, '1', '0', '0', '0', 0, 0, 0, 'admin', 'admin', '2020-11-12 11:53:57', ' 2020-11-12 11:57:27', '4', '0', '');
INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (78, 'cn', '15', '', '航空插头零件材料的选用介绍其本身的性能特点', '#333333', '', '', 'admin', '本站', '', '2020-11-12 11:53:58', '', '', '&lt;p&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;航空插头绝缘体H类的针座的会选用烧结玻璃材料，孔座的则是烧结玻璃密封或者硬质绝缘材料。其他三类通常会选用具有良好的电性能、自熄性、刚度大、挠曲温度高、刚度大、尺寸稳定等特点的纤维增强热塑性聚酯树脂制作绝缘体，该材料吸水率比较差，但是能保持介电强度和抗蠕变性。由于该材料密度低，还具有耐温性能、良好的机械性能和突出的水解稳定性。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 航空插头的弹簧抓、卡环、卡钉等都属于比较关键的弹性零件，都具有起锁紧定位功能。这些关键性零件对航空插头十分重要，因为弹性零件失效往往很容易引起航空插头失效，而弹性零件失效的原因大多都是因为材料质量问题导致的，因此弹性零件材料选用要十分慎重，选用的材料要符合标准，常选用经热处理的铍青铜或不锈钢制作。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 航空插头要用到密封圈、封线体以及界面密封垫等等，这些零件通常会选用硅橡胶、氟硅橡胶或者是耐油橡胶等，选用标准必须具有优良的热和化学稳定性，在极宽的温度范围内有高且恒定的柔软性。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 通常绝缘体和外壳体之间会有间隙，不能完全的精密接触，需要用材料给与填充，这就是灌封材料，灌封材料会选用符合规定的硅橡胶或等效材料。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 总之，航空插头是航天器的重要组成部件，所有材料均需按照要求精挑细选，确保万无一失。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 安装时要注意把指针对应好。指针对好后捏住航空插头的尾部并上紧。安装航空插头时，用手航空插头的尾部用力把螺纹拧紧，不可强用力！插拔航插时不要把线弯曲防止长时间使用会造成接触不良。插拔航插时不可太用力以防止把线拉断造成接触不良。安装航插底座把内环拧紧，防止松动进水。焊接时要注意烙铁的温度，不能太高，根据焊锡丝调整温度高低，一般在400度左右为宜。焊接航插针与线连接部镀锡，多则会造成两针相连容易短路；少则会造成接触不实。加热宿管量好长短，不能让锡暴露在外以防止腐蚀；航插航空插头底座要打胶，关键是封好缝隙防止进水，还要注重美观。各个传感器需要几芯航插对应几根线衡量好。焊接完航空插头以后要用万用表检测各个指针所对应的线是否正确，每个指针是否接触良好。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 首先考虑的机械性能：是指它的插拔力和机械寿命，和接触件正压力大小、接触件接触部位镀层质量、滑动摩擦系数以及接触件排列尺寸精度有关。插拔力是指插入力和拔出力，插入力必须远远低于拔出力，航空插头的大插入力和小拔出力都有严格的规定。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 机械寿命是指耐久性，在国标中称之为机械操作，以航空插头一次插入和一次拔出为一个循环，规定的插拔循环是检验航空插头连接功能是否正常的一个重要评判依据。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 电气性能包括接触电阻、绝缘电阻和抗电强度。一般的航空插头接触电阻有几毫欧，也有数十毫欧，质量高的航空插头，其接触电阻稳定且较低。绝缘电阻从数百兆欧至数千兆欧不等，这是衡量航空插头接触件之间和接触件与外壳之间绝缘性能的重要指标。抗电强度是表征连接器接触件之间或者接触件和外壳之间耐受额定试验电压的能力。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 环境性能是指耐温、耐湿、耐烟雾、抗振和冲击等。目前除了少部分耐高温特种航空插头，大多数连接器的Z高工作温度是200℃，Z低温度在-65℃。工作环境中的潮气会影响到连接器的绝缘性能，还会锈蚀金属零件，因此接插件的恒定湿热试验条件为相对湿度90%-95%、湿度+40+20℃，试验时间按为Z低96小时。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 航空插头工作的环境除了会有潮气，还会有盐分，产生的盐雾会对金属结构件、接触件表面处理层产生电化腐蚀，Z终影响电连接器的电气性能。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;/p&gt;&lt;div style=&quot;margin: 0px; padding: 0px; color: rgb(90, 90, 90); font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px;&quot;&gt; 在航空航天、铁路、公路中使用时Z重要的性能是抗振，耐冲击，这也是检验航空插头是否坚固和可靠的一重要指标。对其进行实验时，冲击试验中峰值加速度、持续时间和冲击脉冲波形，以及电气连续性中断的时间都有明确规定。&lt;/span&gt;&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '', '', '航空插头绝缘体H类的针座的会选用烧结玻璃材料，孔座的则是烧结玻璃密封或者硬质绝缘材料。其他三类通常会选用具有良好的电性能、自熄性、刚度大、挠曲温度高、刚度大、尺寸稳定等特点的纤维增强热塑性聚酯树脂制作绝缘体，该材料吸水率比较差，但是能保持介电强度和抗蠕变性。由于该材料密度低，还具有耐温性能、良好的机械', 107, '1', '0', '0', '0', 0, 0, 0, 'admin', 'admin', '2020-11-12 11:54:20', ' 2020-11-12 11:57:27', '4', '0', '');
INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (79, 'cn', '15', '', '连接器可靠性测试项目及其测试标准有哪些?', '#333333', '', '', 'admin', '本站', '', '2020-11-12 11:54:22', '', '', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;连接器具体测试项目如下：&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（一）连接器插拔力测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-13&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：验证连接器的插拔力是否符合产品规格要求。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;原理：将连接器按规定速率进行完全插合或拔出，记录相应的力值。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（二）连接器耐久性测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-09&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：评估反复插拔对连接器的影响，模拟实际使用中连接器的插拔状况。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;原理：按照规定速率连续插拔连接器直至达到规定次数。&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（三）连接器绝缘电阻测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-21&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：验证连接器的绝缘性能是否符合电路设计的要求或经受高温，潮湿等环境应力时，其阻值是否符合有关技术条件的规定。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;原理：在连接器的绝缘部分施加电压，从而使绝缘部分的表面或内部产生漏电流而呈现出来的电阻值。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（四）连接器耐电压测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-20&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：验证连接器在额定电压下是否能安全工作，能否耐受过电位的能力，从而评定连接器绝缘材料或绝缘间隙是否合适。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;原理：在连接器接触件与接触件之间，接触件与外壳之间施加规定电压并保持规定时间，观察样品是否有击穿或放电现象。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（五）连接器接触电阻测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-06/EIA-364-23&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;目的：验证电流流经接触件的接触表面时产生的电阻值。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;原理：通过对连接器通规定电流，测量连接器两端电压降从而得出电阻值。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（六）连接器振动测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;参考标准：EIA-364-28&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：验证振动对电连接器及其组件性能的影响。&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;振动类型：随机振动，正弦振动 。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（七）连接器机械冲击测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-27&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：验证连接器及其组件耐冲击的能力或评定其结构是否牢固。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;测试波形：半正弦波，方波。&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（八）连接器冷热冲击测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-32&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：评估连接器在急速的大温差变化下，对于其功能品质的影响。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（九）连接器温湿度组合循环测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-31&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：评估连接器在经过高温高湿环境储存后对连接器性能的影响。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（十）连接器高温测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-17&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：评估连接器暴露在高温环境中于规定时间后端子和绝缘体性能是否发生变化。&amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（十一）连接器盐雾测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-26&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：评估连接器，端子，镀层耐盐雾腐蚀能力 。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;（十二）连接器混合气体腐蚀测试&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;参考标准：EIA-364-65&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;目的：评估连接器暴露在不同浓度混合气体中的耐腐蚀能力及对其性能的影响。&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '', '', '连接器具体测试项目如下：（一）连接器插拔力测试参考标准：EIA-364-13目的：验证连接器的插拔力是否符合产品规格要求。原理：将连接器按规定速率进行完全插合或拔出，记录相应的力值。（二）连接器耐久性测试参考标准：EIA-364-09目的：评估反复插拔对连接器的影响', 108, '1', '0', '0', '0', 0, 0, 0, 'admin', 'admin', '2020-11-12 11:54:38', ' 2020-11-12 11:57:27', '4', '0', '');
INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (80, 'cn', '16', '', '连接器的基本应用领域以及内部构成', '#333333', '', '', 'admin', '本站', '', '2020-11-12 11:54:39', '', '', '&lt;p&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;一台机器的内部结构非常的复杂繁琐，而且机器、电器、设备的组成都离不开连接器，常需要用到的连接器就包括有：SIM卡座，SD/TF卡座，SATA连接器，板对板连接器，PCIE连接器，USB连接器等，这些连接器就已经成为了必不可缺的电子配件，电子连接器的使用性能、规格尺寸都有所不同，下面由科技为您详细介绍，连接器产品主要都使用在哪些产品上：物控产品、网络接收器、机顶盒、数码相机、电脑周边、播放机类、汽车及汽车周边产品，无人机、记录仪、安防设备、医疗设备等等多种用途。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 连接器的基本结构件有：接触件、外壳、绝缘体、附件&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 1、接触件是连接器完成电连接功能的核心零件。一般是由阳性接触件和阴性接触件两部分组成接触的，通过阴阳接触件的插合完成的电连接。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 阳性接触件是刚性零件，其中形状分为圆柱形（圆插针），方柱形，或扁平形。阳性接触件一般是由黄铜，磷青铜制成的。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 阴性接触件即插孔，是接触的关键零件，他是依靠弹性结构在与插针插合时发生弹性变形而产生弹性力与阳性接触件形成紧密接触，完成连接。插孔的结构种类有很多，分别有圆筒型，音叉型、悬臂梁型、盒型等等。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 2、壳体：也称外壳，也就是连接器的外罩，它由内装的绝缘安装板和插针提供机械保护，并且提供插头和插座合适对准，将连接器固定到设备上&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 3、绝缘体：绝缘体称为基座或者安装版，它的作用就是使接触件按锁需要的位置和间距进行排列，并且保证接触件之间和接触件外壳之间的绝缘性能。良好的绝缘电阻、耐点压性能以及易加工性是选择绝缘材料加工成绝体的基本要求。&lt;/span&gt;&lt;br style=&quot;white-space: normal; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;/&gt;&lt;span style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt; 4、附件：附件分结构附件和安装附件两种。结构附件入卡圈、定位健、定位销、导向销、联接环、电缆夹、密封圈、密封垫。安装附件乳螺钉、螺母、螺杆、弹簧圈等。附件大部分都是有标准件和通用件的。&lt;/span&gt;&lt;/p&gt;', '', '', '', '一台机器的内部结构非常的复杂繁琐，而且机器、电器、设备的组成都离不开连接器，常需要用到的连接器就包括有：SIM卡座，SD/TF卡座，SATA连接器，板对板连接器，PCIE连接器，USB连接器等，这些连接器就已经成为了必不可缺的电子配件，电子连接器的使用性能、规格尺寸都有所不同，下面由科技为您详细介绍，连接器产品主要都使', 1, '1', '0', '0', '0', 0, 0, 0, 'admin', 'admin', '2020-11-12 11:55:00', ' 2020-11-12 11:56:56', '4', '0', '');
INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (81, 'cn', '16', '', '尘土对连接器航空插头的影响', '#333333', '', '', 'admin', '本站', '', '2020-11-12 11:55:02', '', '', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;尘土，是我们生活中极其常见的污染物，它的成份十分复杂，按重量来计算的话它含有80%无机物，20%的有机物。我们现在来看一下，灰尘中的无机物会对连接器航空插头的接触体造成哪些影响和危害。&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;1、&amp;nbsp;可溶性盐危害&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;尘土成分中含有可溶性盐，可溶性盐具有一定的吸水性，其附在金属表面微孔内，在潮热环境下会形成电解液，这个电解液积聚在微孔底部，电解液中的SO4-2、CL-等酸根离子会对金属进行腐蚀，腐蚀生成物蔓延聚集到微孔表面的话就会大幅度增加接触电阻。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;2、&amp;nbsp;微颗粒对电镀层危害&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;尘土可以在电镀的过程中吸附在接触体表面，吸附表面的尘土会让镀层表面形成微孔。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;3、&amp;nbsp;直接吸附对接触体的危害&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;尘土直接吸附在接触体表表面上，会造成连接器航空插头闭合时的高电阻值&amp;nbsp;，导&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;致接触失效。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;4、&amp;nbsp;硬质尘土对接触体摩擦危害&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;硬质尘土会加大接触体插拔时的摩擦力，接触体的接触的正压力越大，接触电阻就越小，硬质尘土会抵消减弱接触正压力，从而增大动态接触电阻。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;我们日常中往往非常容易忽视防尘的保护工作，如果让接触体长期暴露在尘土下，则接触体的电气性能就会慢慢下降，甚至失效。那么我们如何解决防尘的问题呢？&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;1、防尘盖：&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;一般圆形航空插头设计时都会配套设计防尘盖，在多尘土的环境下，或者暂时不需要插合使用的航空插头，没有使用时必须要使用防尘盖。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;2、线端的保护&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;线端指的是非固定在设备上、可分离的，连接电缆的那部分航空插头，如果在多尘土环境中工作的，须选择带有橡胶管或格兰头的产品，橡胶管不仅可以减少线缆与外壳的摩擦，更重要的是它可以通过压线盖压紧就可以提供足够的防尘保护，格兰头不仅可以防尘，也可以防水。如果选择的连接器航空插头不具备这两种附件，则需要在电缆与外壳连接部分加上热缩套管，或者其他柔性可收缩材料包覆保护起来，如果有条件可以在制作线束时对连接器尾部进行包塑。&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;重视提高连接器航空插头的尘土防护，不仅是供应方的设计生产要务，也是使用方平时使用操作时的要务，连接器航空插头长时间使用后出现的各种失效问题，尘土是很重要的影响因素之一。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '', '', '', '尘土，是我们生活中极其常见的污染物，它的成份十分复杂，按重量来计算的话它含有80%无机物，20%的有机物。我们现在来看一下，灰尘中的无机物会对连接器航空插头的接触体造成哪些影响和危害。1、可溶性盐危害尘土成分中含有可溶性盐，可溶性盐具有一定的吸水性，其附在金属表面微孔内，在潮热环境下会形成', 2, '1', '0', '0', '0', 0, 0, 0, 'admin', 'admin', '2020-11-12 11:55:23', ' 2020-11-12 11:56:56', '4', '0', '');
INSERT INTO ay_content (id, acode, scode, subscode, title, titlecolor, subtitle, filename, author, source, outlink, date, ico, pics, content, tags, enclosure, keywords, description, sorting, status, istop, isrecommend, isheadline, visits, likes, oppose, create_user, update_user, create_time, update_time, gtype, gid, gnote) VALUES (82, 'cn', '16', '', '航空插头绝缘材料详解（一）酚栓模塑料', '#333333', '', '', 'admin', '本站', '', '2020-11-12 11:55:24', '', '', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;航空插头电连接类的绝缘体绝大部分都是热固性塑料，其中起始，目前日系产品使用较多的就是酚醛模塑料。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;酚醛模塑料简称PMC，俗称酚醛塑封料、胶木粉。按用途与性能来分可分为5类：&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 1、通用类；2、耐热类；3、抗冲击类；4、电气类；5、特种塑料。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; white-space: normal; border: medium none; text-indent: 2em; color: rgb(102, 102, 102); font-family: 微软雅黑, &amp;quot;Microsoft YaHei&amp;quot;, Arial; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp